import { Accordion } from "../components"
import dataFaqs from "../fixtures/faqs.json"

export function AccordionContainer() {
  console.log(dataFaqs)

  return (
    <Accordion>
      <Accordion.Header>Frequently Asked Questions</Accordion.Header>
      <Accordion.Frame>
        {/* Accordion Item */}
        {dataFaqs.map(item => (
          <Accordion.Item>
            <Accordion.Top>
              <Accordion.Title>
                {item.header}
              </Accordion.Title>
              <Accordion.Button>
                +
              </Accordion.Button>
            </Accordion.Top>
            <Accordion.Dropdown>
              <Accordion.Body>
                {item.body}
              </Accordion.Body>
            </Accordion.Dropdown>
          </Accordion.Item>
        ))}
      </Accordion.Frame>
      <Accordion.Signup>
        Finish Sign Up 	&#8250;
      </Accordion.Signup>
    </Accordion>
  )
}
